// ==UserScript==
// @name         WaniKani 100% Review Fanfare
// @namespace    http://joncousins.co.uk
// @description  100% review score is hard! Congratulate yourself with a wonderful fanfare!
// @version      0.5.0
// @author       Jon Cousins, ThisIsntTheWay
// @include      http*://*.wanikani.com/*
// @grant        none
// @run-at    document-end
// ==/UserScript==

(function() {
    'use strict';
    //
    // CONFIG OPTIONS
	var b64 = `data:audio/mpeg;base64,`;

    //
    // END CONFIG DONT EDIT BELOW
    //

	var verboseOutput = false;
    var reviewPercentage;
    var reviewResultElement = document.querySelector('#review-stats-answered-correctly .review-stats-value');
    var logPrefix = 'WaniKani 100% Review Fanfare: ';

    if (reviewResultElement == null) {
		if (doDebug) {
			console.log(logPrefix, "var 'reviewResultElement' is NULL, possibly not on review page.");
		}
        return;
    } else {
		reviewPercentage = +reviewResultElement.textContent.trim();
	}

    /* Only execute if review & is actually 100 */
    if (reviewPercentage == 100) {
		try {
			// To circumvent autoplay policies, a seperate audio tag instead of 'new Audio()' will be created.
			// Tested using Chrome v101
			
			// Create audio tag
			var audioTag = document.createElement('audio');
				audioTag.setAttribute("autoplay", '');
			
			// Set source
			var sourceTag = document.createElement('source');
				audioTag.setAttribute("src", b64);
				sourceTag.setAttribute('type', 'audio/mp3');
			
			// Assemble DOMs
			audioTag.appendChild(sourceTag);
			document.body.appendChild(audioTag);
			
		} catch (e) {
			console.error(logPrefix, 'Error during assembly! ', e);
			return;
		}
    } else {
		if (doDebug) {
			console.error(logPrefix, 'Review score is not 100%.');
		}
		
        return;
	}
})();
